      <label for="formGroupExampleInput">Name</label>
      <input type="text" class="form-control" id="formGroupExampleInput" name="name" ngModel [value]="task.name" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Start Date</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" name="startDate"  ngModel [value]="task.startDate"  required>
    </div>

    <div class="form-group">
      <label for="formGroupExampleInput2">End Date</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" name="endDate"  ngModel [value]="task.endDate" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Status</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" name="status"  ngModel [value]="task.status" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Priority</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" name="priority"  ngModel [value]="task.priority" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Progress</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" name="progress"  ngModel [value]="task.progress" required>
    </div>
    <button type="submit" class="btn btn-primary mt-3">Update</button>
  </form>
